////////////////////////////////////////////////////////////////////////////////////////\n  //                                                          GLOBAL VARIABLES\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  /** Object for defining the login form -  @type {FormGroup} */\n  loginForm: FormGroup;\n  /** To check if form has been submitted - @type {boolean} */\n  submitted: boolean = false;\n  /** To check if form has been submitted correctly - @type {boolean} */\n  valid: boolean = false;\n  /** To check if user is logged in - @type {boolean} */\n  loggedIn: boolean = false;\n  /** Array of Organization objects for form dropdown - @type {Organisation[]} */\n  organizations: Interface.Organisation[];\n  /** Array of User Type objects for form dropdown - @type {UserType[]} */\n  userTypes: Interface.UserType[];\n  /** If page is busy loading something - @type {boolean} */\n  loading: boolean = false;\n  /** Selected organisation on dropdown. Used to adjust login form according to organisation selected - @type {string} */\n  selectedOrg: string;\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                             CONSTRUCTOR\n  /**\n   * Creates an instance of LoginComponent.\n   * \n   * @param {AdminAPIService} service For calling the API service\n   * @param {FormBuilder} formBuilder For creating the login form\n   * @param {MatSnackBar} snackBar For snack-bar pop-up messages\n   * @param {MatDialog} dialog For dialog pop-up messages\n   * @param {Router} router For navigating to other modules/components\n   * @memberof LoginComponent\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  constructor(private service: HttpService, private formBuilder: FormBuilder, private snackBar: MatSnackBar, private dialog: MatDialog, \n    private router: Router) {\n    this.loginForm = this.formBuilder.group({\n      organization: ['', Validators.required],\n      login_email: ['', Validators.required],\n      login_password: ['', Validators.required]\n    })\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                              LOGIN\n  /**\n   * This function calls the *http* service to authenticate the user's login details. If the user is authenticated, they're directed \n   * to their respective dashboard. If they're NOT authenticated, an appropriate error message is shown.\n   * \n   * @returns If form input is invalid (eg. not filled out correctly etc.) \n   * @memberof LoginComponent\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  login() {\n\n    this.submitted = true;\n\n    // Check if form input is valid \n    if (this.loginForm.invalid) {\n      return;\n    }\n\n    this.valid = true;\n    this.loading = true;\n\n    // Get form details\n    const Lemail = this.loginForm.controls.login_email.value;\n    const Lpassw = this.loginForm.controls.login_password.value;\n    const Lorg = this.loginForm.controls.organization.value;\n\n    // User details to be passed to API\n    const details: Interface.LoginInfo = { email: Lemail, password: Lpassw, orgName: Lorg };\n\n    this.service.login(details).subscribe((response: any) => {\n\n      this.loading = false;\n      console.log(\"----- RESPONSE 2: \" + JSON.stringify(response));\n      // API Request successful\n      if (response.success == true && response.code == 200) {\n\n        \n        // User NOT Authorised\n        if (response.title != \"AUTHORIZED\") {\n          //POPUP MESSAGE\n          let dialogRef = this.dialog.open(ErrorComponent, { data: { error_title: response.data.title, message: response.data.message, retry: false } });\n          return;\n        }\n        // ELSE user Authorised:\n\n        //Setting local storage to hold the users details\n        localStorage.setItem('userID', response.userDetails.id);\n        localStorage.setItem('userOrganization', Lorg);\n        localStorage.setItem('userPassword', Lpassw);\n\n        //POPUP MESSAGE\n        let snackBarRef = this.snackBar.open(\"Successfully Logged In\", \"Dismiss\", {\n          duration: 3000\n        });\n\n        // Navigate to specific dashboard, based on user's type\n        if(response.userDetails.userType == 'SuperUser'|| response.userDetails.userType == 'ClinicAdmin') {\n          this.router.navigate(['/admin-dashboard']);\n        } else if(response.userDetails.userType == 'OrganizationAdmin') {\n          this.router.navigate(['/organization-dashboard']);\n        } else if(response.userDetails.userType == 'Member') {\n          this.router.navigate(['/member-dashboard']);\n        } else if(response.userDetails.userType == 'Staff') {\n          this.router.navigate(['/staff-dashboard']);\n        } else {\n          let snackBarRef = this.snackBar.open(\"User not supported\", \"Dismiss\", {\n            duration: 3000\n          });\n        }\n        \n\n      } else if (response.success == false) {\n        //POPUP MESSAGE\n        let dialogRef = this.dialog.open(ErrorComponent, { data: { error_title: response.title, message: response.message, status: response.status, retry: false } });\n        dialogRef.afterClosed().subscribe((result) => {\n          if (result == \"Retry\") {\n            this.login();\n          }\n        })\n      }\n    });\n    \n    this.loading = false;\n  }\n\n\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  //                                                    NG_ON_INIT()  \n  /**\n   * This function is called when the page loads\n   * \n   * @description 1. Check if user is already logged in | 2. Check if their session ID (Token) is valid | 3. Populate form drop downs \n   *\n   * @memberof LoginComponent\n   */\n  ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  ngOnInit() {\n\n    //-------- Load Organisation names for Drop Down --------\n    this.service.getAllOrganizations().subscribe((response: any) => {\n      \n      if (response.success == true && response.code == 200) {\n        console.log(response);\n        console.log(response.data);\n        this.organizations = response.data.Organizations;\n\n      } else if (response.success == false) {\n        //POPUP MESSAGE\n        let dialogRef = this.dialog.open(ErrorComponent, { data: { error_title: \"Sorry there was an error loading the Organisations\", message: response.message, retry: true } });\n        dialogRef.afterClosed().subscribe((result) => {\n          if (result == \"Retry\") {\n            this.ngOnInit();\n          }\n        })\n      }\n    });\n\n  }\n\n}\n\n    \n\n    \n        \n\n  \n    \n      WE ARE EXCITED TO WELCOME YOU\n      \n      Why do you need to signup?\n      Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus tristique, est at faucibus sodales, nisi\n        est molestie est, eu rhoncus magna dolor at sem. \n    \n    \n      \n        \n        \n      \n\n      \n      LOGIN\n      \n      \n\n        \n          \n          \n            \n              Organization\n              \n                --\n                \n                  {{organization.orgName}}\n                \n              \n            \n            \n              Please select an organization\n            \n          \n\n          \n          \n            \n              \n              johndoe@gmail.com\n            \n            \n              Please enter your email\n            \n          \n\n          \n          \n            \n              \n              Enter your password\n            \n            \n              Please enter your password\n            \n          \n\n          \n          Logging In...\n\n\n          \n          \n        \n      \n\n    \n  \n\n    \n\n    \n                \n                    ./login.component.scss\n                \n                /* ================================================ */\n/* General Setup                                    */\n/* ================================================ */\n* {\n    margin: 0;\n    padding: 0;\n}\n\nhtml {\n    font-family: 'Open Sans', sans-serif;\n    color: #555;\n}\n\n.container-fluid {\n\n    display: flex;\n    justify-content: center;\n    align-items: center;\n\n    min-height: 100vh;\n    height: 100%;\n\n}\n\n/* ================================================ */\n/* Background Image Style                           */\n/* ================================================ */\n.background-image {\n    position: absolute;\n    top: 0;\n    left: 0;\n    width: 100%;\n    height: 100%;\n    background-size: cover;\n    background-image: url('src/assets/images/primary_background.jpg');\n    z-index: -1;\n}\n\n.background-image:after {\n    content: '';\n    position: absolute;\n    top: 0;\n    left: 0;\n    width: 100%;\n    height: 100%;\n    background-color: #6B8E4E;\n    opacity: 0.3;\n}\n\n/* ================================================ */\n/* Login Card Style                                 */\n/*      Default style is built for mobile devices   */\n/* ================================================ */\n#login-card {\n    display: flex;\n\n    width: 90%;\n    height: 95vh;\n\n    box-shadow: 0 19px 38px rgba(0, 0, 0, 0.30), 0 15px 12px rgba(0, 0, 0, 0.22);\n}\n\n#left {\n    display: flex;\n    flex-direction: column;\n    justify-content: space-evenly;\n\n    background-color: #6B8E4E;\n    color: #ffffff;\n\n    padding: 50px;\n\n}\n\n#right {\n    display: flex;\n    flex-direction: column;\n    align-items: center;\n\n    background-color: #ffffff;\n}\n\n#close-icon {\n    display: flex;\n    justify-content: flex-end;\n\n    width: 100%;\n}\n\n#close-icon i {\n    margin: 10px 10px;\n\n    color: lightgray;\n}\n\n#right h1 {\n    color: #6B8E4E;\n    font-size: 34px;\n}\n\n/* ================================================ */\n/* Responsive Styles                                */\n/* ================================================ */\n@media (max-width: 1023px) {\n    #left {\n        display: none;\n    }\n}\n\n@media (min-width: 1024px) and (max-width: 1439px) {\n    #left {\n        width: 50%;\n    }\n\n    #right {\n        width: 50%;\n    }\n}\n\n@media (min-width: 2560px) {\n    #login-card {\n        flex-direction: column;\n    }\n\n    #left {\n        width: 100%;\n        height: 20%;\n\n        text-align: center;\n    }\n\n    #left h3,\n    p {\n        display: none;\n    }\n\n    #right {\n        width: 100%;\n        height: 80%;\n    }\n\n    .form-group {\n        padding: 0;\n        margin: 0;\n    }\n\n    .row {\n        display: flex;\n        justify-content: flex-start;\n    }\n}\n\n@media (min-width: 768px) and (min-height: 1024px) {\n    #login-card {\n        flex-direction: column;\n    }\n\n    #left {\n        display: flex;\n\n        width: 100%;\n        height: 40%;\n\n        text-align: center;\n    }\n\n    #right {\n        justify-content: center;\n\n        width: 100%;\n        height: 60%;\n    }\n\n    .form-group {\n        padding: 0;\n        margin: 0;\n    }\n\n    .row {\n        display: flex;\n        justify-content: flex-start;\n    }\n}\n\n@media (min-width: 1024px) and (min-height: 768px) {\n    #login-card{\n        height:90vh;\n    }\n\n    #left {\n        justify-content: center;\n    }\n\n    #right {\n        justify-content: center;\n    }\n}\n\n/* ================================================ */\n/* Form and Input Styling                           */\n/* ================================================ */\n.row {\n    display: flex;\n    justify-content: center;\n    text-align: center;\n}\n\n.mat-form-field.mat-focused {\n    .mat-form-field-label {\n        color: #6B8E4E;\n    }\n\n    .mat-form-field-ripple {\n        background-color: #6B8E4E;\n    }\n\n    .mat-form-field-required-marker {\n        color: #6B8E4E;\n    }\n\n    .mat-input-element {\n        color: #6B8E4E;\n    }\n}\n\n.mat-form-field-wrapper {\n    width: 100% !important;\n    font-size: 12px;\n}\n\n\n#right .btn.btn-default {\n    background: #6B8E4E;\n    border: 3px solid #6B8E4E;\n    color: white;\n    font-size: 12px;\n    letter-spacing: 2px;\n    padding: 10px 20px;\n    text-transform: uppercase;\n\n    border-radius: 50px;\n    -moz-border-radius: 50px;\n    -webkit-border-radius: 50px;\n    border: 1px solid #6B8E4E;\n\n}\n\n#right .btn.btn-default:hover,\n#right .btn.btn-default:focus {\n    outline: none;\n    box-shadow: 0 19px 38px rgba(0, 0, 0, 0.30), 0 15px 12px rgba(0, 0, 0, 0.22);\n}\n\n/* ================================================ */\n/* Error Message Styling                            */\n/* ================================================ */\n.errors {\n    margin-top: 1rem;\n    display: block;\n}\n    \n\n    \n        \n        \n            \n                Legend\n            \n            \n                Html element\n            \n            \n                Component\n            \n            \n                Html element with directive\n            \n        \n    \n\n    \n\n\n\n\n\n\n        var COMPONENT_TEMPLATE = '            WE ARE EXCITED TO WELCOME YOU            Why do you need to signup?      Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus tristique, est at faucibus sodales, nisi        est molestie est, eu rhoncus magna dolor at sem.                                                 LOGIN                                                                  Organization                              --                                  {{organization.orgName}}                                                                    Please select an organization                                                                                  johndoe@gmail.com                                      Please enter your email                                                                                  Enter your password                                      Please enter your password                                          Logging In...                                        '\n    var COMPONENTS = [{'name': 'AdminDashboardComponent', 'selector': 'app-admin-dashboard'},{'name': 'AdminDivComponent', 'selector': 'app-admin-div'},{'name': 'AdminProfileComponent', 'selector': 'app-admin-profile'},{'name': 'AppComponent', 'selector': 'app-root'},{'name': 'ClinicHandlerComponent', 'selector': 'app-clinic-handler'},{'name': 'ConfirmComponent', 'selector': 'app-confirm'},{'name': 'DatabaseHandlerComponent', 'selector': 'app-database-handler'},{'name': 'ErrorComponent', 'selector': 'app-error'},{'name': 'HomeComponent', 'selector': 'app-home'},{'name': 'LoginComponent', 'selector': 'app-login'},{'name': 'MemberDashboardComponent', 'selector': 'app-member-dashboard'},{'name': 'MemberHandlerComponent', 'selector': 'app-member-handler'},{'name': 'MemberProfileComponent', 'selector': 'app-member-profile'},{'name': 'MemberSubmitSampleComponent', 'selector': 'app-member-submit-sample'},{'name': 'MemberViewSamplesComponent', 'selector': 'app-member-view-samples'},{'name': 'NotificationDivComponent', 'selector': 'app-notification-div'},{'name': 'OrganizationDashboardComponent', 'selector': 'app-organization-dashboard'},{'name': 'OrganizationHandlerComponent', 'selector': 'app-organization-handler'},{'name': 'OrganizationProfileComponent', 'selector': 'app-organization-profile'